VALUES ('3564700698679', 'Poulet Crudités Parmesan (Pâtes, Œufs, Salade)', 'SALADE COMPOSÉE 89,1 % : mélange de pâtes alimentaires cuisinées 42,1 % (minis conchiglie cuites 27,2 % (eau, semoule de _blé_ dur de qualité supérieure, épices, sel, arômes naturels), carottes râpées 12,6 %, huile d\'olive vierge extra, huile de colza, persil, sel) ; quartiers d\'_œufs_ durs 15,8 % (_œuf_, acidifiants : acide citrique - acide acétique, sel) ; salades mélangées 15,8 % (laitue et chicorée en proportion variable) ; émincé de filet de poulet traité en salaison cuit rôti 14 % (filet de poulet 13,7 %, sel, amidon de tapioca, dextrose) ; tomates cerise 8,8 % ; _parmesan_ râpé 3,5 %. (Pourcentages exprimés sur la salade composée). SAUCE AU VINAIGRE BALSAMIQUE 6,2 % : huile de colza ; vinaigre balsamique 25 % (vinaigre de vin (dont _sulfites_), moût de raisin concentré et cuit, colorant : caramel E150d) ; huile d\'olive vierge extra. (Pourcentages exprimés sur la sauce). BÂTONNETS GRILLÉS AU PARMESAN ET ORIGAN 4,7 % : farine de _blé_ ; _parmesan_ râpé 9,5 % ; huile de tournesol ; huile d\'olive ; origan déshydraté 2,3 % ; sel ; levure. (Pourcentages exprimés sur les bâtonnets grillés).', 'https://static.openfoodfacts.org/images/products/356/470/069/8679/front.23.400.jpg', '11.9', '3.7', '13.8', '4.5', '1.6', '8.3', '0.55', '0.216535433070866', '', '1');

